import React, { Component } from 'react';

class Followedpost extends Component {
  
  constructor(){
    super();
    this.state={
      user:''
    }
  }
  

  componentDidMount(){
    
    const id = this.props.usr_id

    fetch('/followedpost/' + id)
    .then(res => res.json())
    .then(data => this.setState({user:data}));
    
  }

  render() { 
    
    return (
  <div>
  <h5>hey</h5>
  </div>
  );

}}

